  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [farmerName, setFarmerName] = useState('');
  const [farmerId, setFarmerId] = useState('');
  const [farmerLicense, setFarmerLicense] = useState(null);
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [addresses, setAddresses] = useState({
    farmerAddress: {
      street: '',
      city: '',
      province: '',
      zipCode: ''
    },
    farmLocationAddress: {
      street: '',
      city: '',
      province: '',
      zipCode: ''
    }
  });
  const [customerName, setCustomerName] = useState('');
  const [shippingAddress, setShippingAddress] = useState({
    street: '',
    city: '',
    province: '',
    zipCode: ''
  });
  const [workerName, setWorkerName] = useState('');
  const [communicationAddress, setCommunicationAddress] = useState({
    street: '',
    city: '',
    province: '',
    zipCode: ''
  });
  const [skills, setSkills] = useState('');

  const handleSubmit = async (event) => {
    event.preventDefault();

    if (password !== confirmPassword) {
      alert('Passwords do not match');
      return;
    }

    const formData = new FormData();
    formData.append('username', username);
    formData.append('password', password);
    formData.append('userType', userType);
    formData.append('email', email);
    formData.append('phone', phone);

    if (userType === 'Farmer') {
      formData.append('farmerName', farmerName);
      formData.append('farmerId', farmerId);
      formData.append('farmerLicense', farmerLicense);
      formData.append('addressStreet', addresses.farmerAddress.street);
      formData.append('addressCity', addresses.farmerAddress.city);
      formData.append('addressProvince', addresses.farmerAddress.province);
      formData.append('addressZipCode', addresses.farmerAddress.zipCode);
      formData.append('farmLocationStreet', addresses.farmLocationAddress.street);
      formData.append('farmLocationCity', addresses.farmLocationAddress.city);
      formData.append('farmLocationProvince', addresses.farmLocationAddress.province);
      formData.append('farmLocationZipCode', addresses.farmLocationAddress.zipCode);
    } else if (userType === 'Customer') {
      formData.append('customerName', customerName);
      formData.append('shippingStreet', shippingAddress.street);
      formData.append('shippingCity', shippingAddress.city);
      formData.append('shippingProvince', shippingAddress.province);
      formData.append('shippingZipCode', shippingAddress.zipCode);
    } else if (userType === 'Worker') {
      formData.append('workerName', workerName);
      formData.append('communicationStreet', communicationAddress.street);
      formData.append('communicationCity', communicationAddress.city);
      formData.append('communicationProvince', communicationAddress.province);
      formData.append('communicationZipCode', communicationAddress.zipCode);
      formData.append('skills', skills);
    }

    try {
      const response = await fetch('http://localhost:3000/register', {
        method: 'POST',
        body: formData
      });

      const result = await response.json();
      if (response.status === 201) {
        alert(result.message);
        navigate('/login');
      } else {
        alert(result.message);
      }
    } catch (error) {
      console.error('Error:', error);
      alert('Registration failed');
    }
  };

  return (
    <div>
      <Navigation />
      <div className="register-container">
        <form className="register-form" onSubmit={handleSubmit}>
          <h1>Register</h1>
          <div className="form-group">
            <label htmlFor="userType">User Type:</label>
            <select id="userType" value={userType} onChange={(e) => setUserType(e.target.value)} required>
              <option value="">Select User Type</option>
              <option value="Farmer">Farmer</option>
              <option value="Customer">Customer</option>
              <option value="Worker">Worker</option>
            </select>
          </div>
          <div className="form-group">
            <label htmlFor="username">Username:</label>
            <input type="text" id="username" value={username} onChange={(e) => setUsername(e.target.value)} required />
          </div>
          <div className="form-group">
            <label htmlFor="password">Password:</label>
            <input type="password" id="password" value={password} onChange={(e) => setPassword(e.target.value)} required />
          </div>
          <div className="form-group">
            <label htmlFor="confirmPassword">Confirm Password:</label>
            <input type="password" id="confirmPassword" value={confirmPassword} onChange={(e) => setConfirmPassword(e.target.value)} required />
          </div>
          <div className="form-group">
            <label htmlFor="email">Email:</label>
            <input type="email" id="email" value={email} onChange={(e) => setEmail(e.target.value)} required />
          </div>
          <div className="form-group">
            <label htmlFor="phone">Phone:</label>
            <input type="tel" id="phone" value={phone} onChange={(e) => setPhone(e.target.value)} required />
          </div>

          {userType === 'Farmer' && (
            <>
              <div className="form-group">
                <label htmlFor="farmerName">Farmer Name:</label>
                <input type="text" id="farmerName" value={farmerName} onChange={(e) => setFarmerName(e.target.value)} required />
              </div>
              <div className="form-group">
                <label htmlFor="farmerId">Farmer ID:</label>
                <input type="text" id="farmerId" value={farmerId} onChange={(e) => setFarmerId(e.target.value)} required />
              </div>
              <div className="form-group">
                <label htmlFor="farmerLicense">Farmer License:</label>
                <input type="file" id="farmerLicense" onChange={(e) => setFarmerLicense(e.target.files[0])} />
              </div>
              <div className="form-group">
                <label>Farmer Address:</label>
                <input type="text" placeholder="Street" value={addresses.farmerAddress.street} onChange={(e) => setAddresses({ ...addresses, farmerAddress: { ...addresses.farmerAddress, street: e.target.value } })} required />
                <input type="text" placeholder="City" value={addresses.farmerAddress.city} onChange={(e) => setAddresses({ ...addresses, farmerAddress: { ...addresses.farmerAddress, city: e.target.value } })} required />
                <input type="text" placeholder="Province" value={addresses.farmerAddress.province} onChange={(e) => setAddresses({ ...addresses, farmerAddress: { ...addresses.farmerAddress, province: e.target.value } })} required />
                <input type="text" placeholder="Zip Code" value={addresses.farmerAddress.zipCode} onChange={(e) => setAddresses({ ...addresses, farmerAddress: { ...addresses.farmerAddress, zipCode: e.target.value } })} required />
              </div>
              <div className="form-group">
                <label>Farm Location Address:</label>
                <input type="text" placeholder="Street" value={addresses.farmLocationAddress.street} onChange={(e) => setAddresses({ ...addresses, farmLocationAddress: { ...addresses.farmLocationAddress, street: e.target.value } })} required />
                <input type="text" placeholder="City" value={addresses.farmLocationAddress.city} onChange={(e) => setAddresses({ ...addresses, farmLocationAddress: { ...addresses.farmLocationAddress, city: e.target.value } })} required />
                <input type="text" placeholder="Province" value={addresses.farmLocationAddress.province} onChange={(e) => setAddresses({ ...addresses, farmLocationAddress: { ...addresses.farmLocationAddress, province: e.target.value } })} required />
                <input type="text" placeholder="Zip Code" value={addresses.farmLocationAddress.zipCode} onChange={(e) => setAddresses({ ...addresses, farmLocationAddress: { ...addresses.farmLocationAddress, zipCode: e.target.value } })} required />
              </div>
            </>
          )}

          {userType === 'Customer' && (
            <>
              <div className="form-group">
                <label htmlFor="customerName">Customer Name:</label>
                <input type="text" id="customerName" value={customerName} onChange={(e) => setCustomerName(e.target.value)} required />
              </div>
              <div className="form-group">
                <label>Shipping Address:</label>
                <input type="text" placeholder="Street" value={shippingAddress.street} onChange={(e) => setShippingAddress({ ...shippingAddress, street: e.target.value })} required />
                <input type="text" placeholder="City" value={shippingAddress.city} onChange={(e) => setShippingAddress({ ...shippingAddress, city: e.target.value })} required />
                <input type="text" placeholder="Province" value={shippingAddress.province} onChange={(e) => setShippingAddress({ ...shippingAddress, province: e.target.value })} required />
                <input type="text" placeholder="Zip Code" value={shippingAddress.zipCode} onChange={(e) => setShippingAddress({ ...shippingAddress, zipCode: e.target.value })} required />
              </div>
            </>
          )}

          {userType === 'Worker' && (
            <>
              <div className="form-group">
                <label htmlFor="workerName">Worker Name:</label>
                <input type="text" id="workerName" value={workerName} onChange={(e) => setWorkerName(e.target.value)} required />
              </div>
              <div className="form-group">
                <label>Communication Address:</label>
                <input type="text" placeholder="Street" value={communicationAddress.street} onChange={(e) => setCommunicationAddress({ ...communicationAddress, street: e.target.value })} required />
                <input type="text" placeholder="City" value={communicationAddress.city} onChange={(e) => setCommunicationAddress({ ...communicationAddress, city: e.target.value })} required />
                <input type="text" placeholder="Province" value={communicationAddress.province} onChange={(e) => setCommunicationAddress({ ...communicationAddress, province: e.target.value })} required />
                <input type="text" placeholder="Zip Code" value={communicationAddress.zipCode} onChange={(e) => setCommunicationAddress({ ...communicationAddress, zipCode: e.target.value })} required />
              </div>
              <div className="form-group">
                <label htmlFor="skills">Skills:</label>
                <input type="text" id="skills" value={skills} onChange={(e) => setSkills(e.target.value)} required />
              </div>
            </>
          )}

          <button type="submit">Register</button>
        </form>
      </div>
      <Footer />
    </div>
  );
}

export default Register;
